import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";

function getData(data) {
  return <Note key={data.key} title={data.title} content={data.content} />;
}

function App() {
  return (
    <div>
      <Header />
      <Note />
      <Footer />
    </div>
  );
}

export default App;
